import React from 'react'
import {
	View,
	StyleSheet,
	Text,
	TextInput,
	Pressable,
 } from "react-native";
import List from '../components/List';
import TodoForm from '../components/TodoForm';

const Main = () => {
  return (
	  <View>
		  <TodoForm/>
		  <List/>
	  </View>
  )
}

export default Main
